import{_ as e,o as a,c as r,O as t}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 23.1-2701 Membership.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-2701.md","filePath":"vacode/23.1-2701.md"}'),o={name:"vacode/23.1-2701.md"},i=t('<h1 id="§-23-1-2701-membership" tabindex="-1">§ 23.1-2701 Membership. <a class="header-anchor" href="#§-23-1-2701-membership" aria-label="Permalink to &quot;§ 23.1-2701 Membership.&quot;">​</a></h1><p>A. The board shall consist of 15 members appointed by the Governor, of whom at least three shall be alumni of the University and at least 10 shall be residents of the Commonwealth.</p><p>B. The alumni association of the University may submit to the Governor a list of three nominees for each vacancy on the board, whether the vacancy occurs by expiration of a term or otherwise. The Governor may appoint a member from the list of nominees.</p><p>1964, c. 70, § 23-165.4; 1979, c. 147; 1993, c. 697; 1999, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0752" target="_blank" rel="noreferrer">752</a>; 2008, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0465" target="_blank" rel="noreferrer">465</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0477" target="_blank" rel="noreferrer">477</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',4),n=[i];function s(h,l,c,p,m,_){return a(),r("div",null,n)}const d=e(o,[["render",s]]);export{b as __pageData,d as default};
